(697, 'acc', 'grand oak', '2018-8-28 10:02:46', '2018-8-28 12:43:03', '2.68', NULL, 'This client\'s name is \'The Grand Oak\' and brand new wedding/private event venue here in Turlock.\r\n\r\nWe are creating two separate Squarespace sites but need one central landing page for the customers to go to and that will be used on all marketing materials. On the landing page there will be a Wedding Button and then a Private Events button - the user can then click on whichever one they are interested in and that will link them to the Squarespace site.\r\n\r\nI\'ve attached a mock-up of the landing page that Ali and I drew out.\r\n\r\nThe feel of the event venue is elegant (think 7 chandeliers in the main ballroom) but also keeping a modern feel with dark colors so the space can be versatile for more than just weddings. It fit up to 400 people so it\'s \'grand\' no pun intended.\r\n\r\nHere is the Dropbox folder I shared with you for their Logo;\r\n\r\nhttps://www.dropbox.com/home/Team%20Ali%20Cox%20and%20Co%20Team%20Folder/The%20Grand%20Oak%20Event%20Venue/Final%20Logo\r\n\r\nAddress;\r\n1550 N. Soderquist Rd\r\nTurlock, CA 95380\r\n209-656-9219\r\n\r\nCan you use placeholder photography for the images on the sheet I drew up?\r\n\r\nHappy to jump on a call today to go over this more. We are meeting with them Friday, do you think Ali and I could see something by tomorrow afternoon or Thursday?'),
