(703, 'acc', 'grand oak', '2018-8-29 10:57:15', '2018-8-29 12:53:43', '1.93', NULL, 'Thanks for getting this Grand Oak website landing page together. Here are Haley and my edits please:\r\n\r\n1. Please crop the white space around the Grand Oak logo  -- please see the wireframe attached that we presented a few weeks back. This is the design inspiration. (Please note, we\'re not using 3 images on your landing page, please keep the two we\'ve attached here on this email).\r\n2. Please replace the existing photos with the attached\r\n3. Please crop the pic w/ the gold chairs so that you can\'t see the white wall (this is for the private events image)\r\n4. Take off the twitter icon in the corner\r\n5. Can you write Weddings and Private events ON TOP OF the photos - and please use interesting, swirly letters for the WEDDING image and then more corporate lettering for the Private events image.\r\n6. Please ADD \"& Corporate Meetings\" to title - so will be: \"Private Events & Corporate Meetings\" ((on top of the gold chair image))\r\n7. Change address from 1550 TO 1450\r\n8. Please replace phone number with this new number: (209) 484-2822\r\n9. Please note - in a few days, we\'ll have links for BOTH pages.'),
